import React from 'react';
import { Line } from 'rc-progress';

const skillProgress = (props) => {
    return (
        <div>{props.skill}<Line percent={props.percentage} strokeWidth="1" strokeColor="#35495e" /></div>
    );
}
export default skillProgress;
